_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"154090","type":"CustomJS"},{"attributes":{"editor":{"id":"154252"},"field":"Max. Drawdown [%]","formatter":{"id":"154251"},"title":"Max. Drawdown [%]"},"id":"154201","type":"TableColumn"},{"attributes":{"editor":{"id":"154300"},"field":"ExitTime","formatter":{"id":"154299"},"title":"ExitTime"},"id":"154175","type":"TableColumn"},{"attributes":{"editor":{"id":"154274"},"field":"Profit Factor","formatter":{"id":"154273"},"title":"Profit Factor"},"id":"154212","type":"TableColumn"},{"attributes":{"fill_color":{"value":"cyan"},"hatch_color":{"value":"cyan"},"line_color":{"value":"cyan"},"size":{"value":8},"x":{"value":6466},"y":{"value":1.4501468728373685}},"id":"153850","type":"Scatter"},{"attributes":{"editor":{"id":"154288"},"field":"ExitBar","formatter":{"id":"154287"},"title":"ExitBar"},"id":"154169","type":"TableColumn"},{"attributes":{"format":"0,0.[00]%"},"id":"153847","type":"NumeralTickFormatter"},{"attributes":{},"id":"154292","type":"StringEditor"},{"attributes":{"columns":[{"id":"154201"},{"id":"154202"},{"id":"154203"},{"id":"154204"},{"id":"154205"},{"id":"154206"},{"id":"154207"},{"id":"154208"},{"id":"154209"},{"id":"154210"},{"id":"154211"},{"id":"154212"},{"id":"154213"},{"id":"154214"}],"disabled":true,"fit_columns":true,"height":60,"index_position":null,"reorderable":false,"sizing_mode":"stretch_width","source":{"id":"154200"},"view":{"id":"15421
